    fabs_data = [{"data": "FABS data 1"}, {"data": "FABS data 2"}]
    data_loader.load_fabs_data(fabs_data)

    ui_designer.redesign_resources_page()

    fabs_file = File("FABS file", "FABS file content")
    fabs_user.submit_fabs_data(fabs_file)

    files = [File("File 1", "File 1 content"), File("File 2", "File 2 content")]
    broker_user.upload_and_validate_files(files)

    synced_data = sync_d1_file_generation_with_fpds_data_load(fpds_data, d1_files)
    print(synced_data)

    ppopzip_data = make_ppopzip_work_like_legal_entity_zip_validations({"data": "PPoPZIP+4 data"})
